import React, { Component, setState } from 'react';
import axios from 'axios';
import './App.css';

const api = axios.create({
  baseURL: `http://www.devcodecampmusiclibrary.com/api/music`
})
const tableData = "";

class App extends Component {

  state = {
    musicCollection:[]
  }

  constructor() {
    super();
    this.getMusic();
  } catch (err){
    console.log(err);
  }

  getMusic = async () => {
    let data = await api.get('/').then(({data}) => data);
    this.setState({ musicCollection: data});
    console.log(data);
  }

  renderTableData(){
    return this.state.musicCollection.map((music, i) => {
      const { id, title, album, artist, genre } = music
      return (
        <tr key={id}>
          <td>{title}</td>
          <td>{album}</td>
          <td>{artist}</td>
          <td>{genre}</td>
        </tr>
      )
    })
  }

  render(){
    return (
    <div className="App">
      <header className="App-header">
        <h3 className="display-4">Music Library Search</h3>

      <div className="table-data">
        {this.state.musicCollection.map(music => <td key={music.id}>{music.title}</td>)}
      </div>
      </header>  
    </div>
    )};
}

export default App;
